import './Feed.css';
import PostBox from "./PostBox";

function Feed() {
    return (
        <div className="feed">
            {/* Header */}
            <div className="feed__header">
                <h2>Home</h2>
            </div>

            {/* Posts */}
            <PostBox />

        </div>
    )
}

export default Feed
